import styled from 'styled-components';

const Container = styled.div`
  position: relative;
  width: 100vh;
  height: 40vh;
  background: black;
`;
const Card = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  margin: -25px 0 0 -25px;
  font-color: white;
`;

const CCMaker = () => {
  return (
    <Container>
      <Card>Hello worlddd</Card>;
    </Container>
  );
};

export default CCMaker;
